@NgModule({
  declarations: [
    AppComponent,
    ProductsComponent,
    HighlightDirective,
    ProductDetailComponent,
    CartComponent,

  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    FormsModule,
    NgxPaginationModule,
